        // control that shows state info on hover
        var info = L.control();

        info.onAdd = function (map) {
            this._div = L.DomUtil.create('div', 'info');
            this.update();
            return this._div;
        };


        info.update = function (props) {
            if (props)
            {
                var datestr = ''
                if (props.start != props.end)
                {
                    datestr = '<br />' + props.start + ' - ' + props.end
                }
                var commentstr = ''
                if (props.comment)
                {
                    commentstr = '<p>' + props.comment + '</p>';
                }
            }
            this._div.innerHTML = '' +  (props ?
                '<div align=left><b>' + props.name + '</b>' + datestr + commentstr+'</div>'
                : 'Hover over a state');
        };

        info.addTo(map);


        function getColor(d) {
            return  d > 120   ? '#060261' :
                    d > 90   ? '#0b03a8' :
                    d > 70   ? '#180df8' :
                    d > 50   ? '#3127fa' :
                    d > 30   ? '#483ff8' :
                    d > 20   ? '#665ff3' :
                    d > 15   ? '#847ef8' :
                    d > 10   ? '#a09cfa' :
                    d > 5   ? '#bab7ff' :
                    d > 0   ? '#ffffff' :
                    '#ffffff' ;

        }

        function style(feature) {
            return {
                weight: 2,
                opacity: 1,
                color: 'white',
                dashArray: '3',
                fillOpacity: 0.7,
                fillColor: getColor(feature.properties.level)
            };
        }

        function highlightFeature(e) {
            var layer = e.target;

            layer.setStyle({
                weight: 5,
                color: '#666',
                dashArray: '',
                fillOpacity: 0.7
            });

            if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
                layer.bringToFront();
            }

            info.update(layer.feature.properties);
        }

        function resetHighlight(e) {
            geojson.resetStyle(e.target);
            info.update();
        }

        function zoomToFeature(e) {
            map.fitBounds(e.target.getBounds());
        }

        var popup = L.popup();

        function onMapClick(e) {
            var datestr = ''
                if (e.sourceTarget.feature.properties.start != e.sourceTarget.feature.properties.end)
                {
                    datestr = '<br />' + e.sourceTarget.feature.properties.start + ' - ' + e.sourceTarget.feature.properties.end
                }
                var commentstr = ''
                if (e.sourceTarget.feature.properties.comment)
                {
                    commentstr = '<p>' + e.sourceTarget.feature.properties.comment + '</p>';
                }
            popup
                .setLatLng(e.latlng)
                .setContent('<div align=left><b>' + e.sourceTarget.feature.properties.name + '</b>' + datestr + commentstr+'</div>')
                .openOn(map);
        }

        function onEachFeature(feature, layer) {
            layer.on({
                mouseover: highlightFeature,
                mouseout: resetHighlight,
                click: onMapClick
            });
        }

        var geojson = L.geoJson(statesData, {
            style: style,
            onEachFeature: onEachFeature
        }).addTo(map);

